import React from "react";
import "./inlogpage.css"
import PinknavLeft from "../../Components/Pinknav/pinknav-left";
import { useForm } from 'react-hook-form';
import {Link} from "react-router-dom";
import FormFieldText from "../../Components/Form-input/text-input/form field text";
import ButtonBasic from "../../Components/Buttons/button";

function InlogPage(){
    const { handleSubmit, formState: { errors }, register } = useForm();
    function onFormSubmit(data) {
        console.log(data);
    }
    return(
        <>
        <PinknavLeft/>

            <header className='inner-container-right header-inlog'>
                <div>
                  <h1> Inloggen</h1>
                 </div>
            </header>
            <section className='inner-container-right registration'>
                <form onBlur={handleSubmit(onFormSubmit)}>


                    <FormFieldText
                    type="email"
                    title="E-mail:"
                    name="e-mail"
                    id="e-mail"
                   register={register}
                        />

                    <FormFieldText
                        type="password"
                        title="Wachtwoord"
                        name="password"
                        id="password"
                        register={register}
                    />

                    <label htmlFor="details-name">
                        Naam:
                        <input
                            type="text"
                            id="details-name"
                            {...register("name", {
                                validate: {
                                    value: (value) => value.includes('@'),
                                    message: "Naam mag geen @ bevatten",
                                },
                            })}
                        />
                    </label>
                    {errors.name && <p>{errors.name.message}</p>}

                    <Link to="/">

                    <ButtonBasic
                        title="Inloggen"
                        type="submit"
                        />
                    </Link>

                </form>
                <p>Heb je nog geen account? <Link to="/registreer">Registreer</Link> je dan eerst.</p>
            </section>
        </>
    )

};

export default InlogPage
